import React from 'react';
import './Projects.css';


function Project({
    headLine, img, alt, description, projectLink
}) {  return (
        <>
        <div className='project-container'>
            <h1 className="work-header-text">
                <a href={projectLink} target="_blank">{headLine}</a>
            </h1>
        </div>

        </>
    )
}

export default Project;
